function sProcId = wGetMyProcId(Wasdi)% Gets own processor ID% Syntax% sProcId = wGetProcessorPayloadAsJSON(Wasdi, sProcessObjId)% % INPUT%    Wasdi: Wasdi object created after the wasdilib call%% :Returns:%   sProcId: own processor ID  if exist("Wasdi") < 1     disp('Wasdi variable does not exist')    return   end      sProcId = char(Wasdi.getMyProcId());   end